import React from 'react';

const chart = (props) => {


    const myConfig = {
        "type": "line",
        "series": [
           {"values": [20,40,25,50,15,45,33,34] },
           {"values": [5,30,21,18,59,50,28,33] },
           {"values": [30,5,18,21,33,41,29,15] }
        ],
        "plot": {
           "animation": {
              "effect": 1,
              "sequence": 1, 
              "speed": 10
           }
        }
     };


    return ( 
        <div className="chart">
            {myConfig({
                id: 'myChart',
                data: myConfig,
                height: "100%",
                width: "100%"
            })}

        </div>
     );
}

export default chart;
